  Catherine b. at Suva, Fiji. Address: 83 Volga Street, Island Bay, Wellington.
  Catherine graduated MA with Distinction from the University of Otago and is now a policy
  analyst with the Ministry of Education.
  03> McMECHAN, Alistair Donald
  b 28.09.1974
  Alistair b. at Suva, Fiji. Address: 130 Cargill Street, Dunedin,
  Alistair attended Lord Byng secondary school, Vancouver, BC. After completing an honours
  degree in History, he is now completing an honours degree in Law at the University of Otago.
